import React from "react";
import "../Styles/header.css";

let backImage = {
  height: "100%",
  width: "100%",
  backgroundImage: require("../Images/back_image.jpg")
};

class MainSkeleton extends React.Component {
  render() {
    return (
      <div className="bg">
        <div className="header">
          <a href="#default" className="logo">
            <img
              src={require("../Images/logo.png")}
              alt="company logo"
              height="53px"
              width="200px"
            />
          </a>
          <a className="item1" href="#default">
            Explore Restaurants
          </a>
        </div>
      </div>
    );
  }
}

export default MainSkeleton;
